import argparse

def extract_gtf_test(gtfFile, geneTest, listTranscriptUsed):
    """
    FUNCTION DESCRIPTION:
        This function exctract a gene from a gtf for a programm test.
    
    INPUT:
        - gtfFile: the gtf file with all genes.
        - geneTest: the gene test to extract.
        
    OUTPUT:
        - The gene test gtf file.
    """
    with open(gtfFile, 'r') as f_i:
        with open(geneTest+'.gtf', 'w') as f_o:
            lecture = f_i.readlines()
            for line in lecture:
                if geneTest in line:
                    if "transcript_id" in line:
                        line_read_transcript_id = line.replace('\n', '').split('\t')[8].replace('"', '').replace(';', '').split(" ")[5]
                        if line_read_transcript_id in listTranscriptUsed:
                            f_o.write(line)
                    else:
                        f_o.write(line)
                
    return geneTest
    

